import React from 'react';

import classes from './Toolsbar.module.css';

const toolbar = props => (
    <header className={classes.Toolsbar}>
        <DrawerToggle />
        <nav>
            <NavigationItems/>
        </nav>
    </header>
);

export default toolbar;
